def freq_count(list1):
    """
    Get the frequency of the elements in a list.

    For example:
    freq_count([1, 2, 2, 3, 3, 3]) == 6
    freq_count([1, 2, 3]) == 3
    freq_count([1, 1, 1, 1, 1]) == 5
    """
    freq = {}
    for item in list1:
        if item in freq:
            freq[item] += 1
        else:
            freq[item] = 1
    return len(freq)
