def common_in_nested_lists(nestedlist) -> list:
    """
    Given a nested list, find common elements in the given nested lists.
    For example:
    common_in_nested_lists([[1, 2, 3], [3, 4, 5], [1, 3, 6]]) == [1, 3]
    common_in_nested_lists([[1, 2], [3, 4]]) == []
    common_in_nested_lists([[1, 2, 3], [1, 2]]) == [1, 2]
    """
    if not nestedlist:
        return []

    common = []
    first = True

    for item in nestedlist:
        if len(item) == 0:
            continue
        if first:
            common.append(item[0])
            first = False
        else:
            if item[0] in item[1:]:
                common.extend(common[item[1:]:])
            else:
                common.append(item[0])

    return common
```

