def max_path_sum(tri, m, n):
    """
    Finds the maximum total path sum in the given triangle.

    Args:
        tri: A list of lists representing the triangle.
        m: The number of rows in the triangle.
        n: The number of columns in the triangle.

    Returns:
        The maximum total path sum.
    """
    dp = [[0] * (n + 1) for _ in range(m + 1)]

    for i in range(1, m + 1):
        for j in range(1, n + 1):
            if tri[i - 1][j - 1] == 0:
                dp[i][j] = 0
            else:
                dp[i][j] = dp[i - 1][j]
                if i > 1 and j > 1 and tri[i - 2][j - 2] == 0:
                    dp[i][j] = max(dp[i][j], dp[i - 2][j] + tri[i - 1][j - 1])
                if i > 1 and j < n and tri[i - 2][j + 1] == 0:
                    dp[i][j] = max(dp[i][j], dp[i - 2][j + 1] + tri[i - 1][j - 1])
                if i < m and j > 1 and tri[i + 1][j - 1] == 0:
                    dp[i][j] = max(dp[i][j], dp[i + 1][j - 1] + tri[i - 1][j - 1])
                if i < m and j < n and tri[i + 1][j + 1] == 0:
                    dp[i][j] = max(dp[i][j], dp[i + 1][j + 1] + tri[i - 1][j - 1])

    return dp[m][n]
```

