def is_valid_parenthese(str1):
    """
    Verifies the validity of a string of parentheses.

    Args:
        str1: The string to validate.

    Returns:
        True if the string is valid, False otherwise.
    """
    stack = []
    parentheses_map = {')': '(', '}': '{', ']': '['}
    for char in str1:
        if char in parentheses_map.values():
            stack.append(char)
        elif char in parentheses_map.keys():
            if not stack or stack[-1] != parentheses_map[char]:
                return False
            stack.pop()
    return not stack
