def max_sum(arr, n):
    """
    Finds the maximum sum of bi-tonic sub-sequence for the given array.

    Args:
        arr: The input array.
        n: The size of the array.

    Returns:
        The maximum sum of a bi-tonic sub-sequence.
    """
    max_sum = 0
    for i in range(1 << n):
        sub_sequence = []
        for j in range(n):
            if (i >> j) & 1:
                sub_sequence.append(arr[j])
        if not sub_sequence:
            continue
        is_bi_tonic = True
        for k in range(len(sub_sequence)):
            for l in range(k + 1, len(sub_sequence)):
                if sub_sequence[k] >= sub_sequence[l]:
                    is_bi_tonic = False
                    break
            if not is_bi_tonic:
                break
        if is_bi_tonic:
            max_sum = max(max_sum, sum(sub_sequence))
    return max_sum
```

