        int: The maximum sum of a bi-tonic sub-sequence.
    """
    max_sum_val = 0
    for i in range(1 << n):
        subsequence = []
        for j in range(n):
            if (i >> j) & 1:
                subsequence.append(arr[j])
        if not subsequence:
            continue
        current_sum = sum(subsequence)
        is_bi_tonic = True
        for k in range(len(subsequence)):
            for l in range(k + 1, len(subsequence)):
                if subsequence[k] >= subsequence[l]:
                    is_bi_tonic = False
                    break
            if not is_bi_tonic:
                break
        if is_bi_tonic:
            max_sum_val = max(max_sum_val, current_sum)
    return max_sum_val
