import cmath

def convert(numbers):
    """Converts complex numbers to polar coordinates.

    Args:
        numbers: A list of complex numbers.

    Returns:
        A tuple containing the real and imaginary parts of the polar coordinates.
    """
    real_part = real_part_from_complex(numbers)
    imaginary_part = imaginary_part_from_complex(numbers)
    return (real_part, imaginary_part)

def real_part_from_complex(complex_number):
    """Converts a complex number to its real and imaginary parts."""
    return complex_number.real + cmath.phase(complex_number)

def imaginary_part_from_complex(complex_number):
    """Converts a complex number to its imaginary and real parts."""
    return complex_number.imag + cmath.phase(complex_number)
