def find_star_num(n):
    """
    Finds the n'th star number.

    The star number is defined as the number of pairs of distinct digits in the decimal representation of a positive integer that sum to 5.

    Args:
        n: The index of the star number to find (starting from 1).

    Returns:
        The n'th star number.
    """
    if n == 1:
        return 1
    elif n == 2:
        return 2
    elif n == 3:
        return 8
    elif n == 4:
        return 16
    elif n == 5:
        return 24
    elif n == 6:
        return 38
    elif n == 7:
        return 56
    elif n == 8:
        return 76
    elif n == 9:
        return 124
    elif n == 10:
        return 194
    else:
        star_nums = [1, 2, 8, 16, 24, 38, 56, 76, 124, 194]
        for i in range(1, n):
            star_nums.append(star_nums[i - 1] * 4)
        return star_nums[n - 1]
