def max_aggregate(stdata):
    """
    Calculate the maximum aggregate from the list of tuples.

    Args:
      stdata: A list of tuples, where each tuple contains a key-value pair.

    Returns:
      The maximum aggregate value.
    """
    if not stdata:
        return 0

    aggregate = {}
    for key, value in stdata:
        if key in aggregate:
            aggregate[key] += value
        else:
            aggregate[key] = value

    if not aggregate:
        return 0

    return max(aggregate.values())
