def count_binary_seq(n):
    """
    Finds the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.

    Args:
        n: An integer representing half the length of the binary sequence.

    Returns:
        An integer representing the count of such sequences.
    """
    dp = {}

    def solve(idx, current_sum, first_n, last_n):
        if idx == 2 * n:
            return 1 if current_sum == last_n else 0

        if (idx, current_sum, first_n, last_n) in dp:
            return dp[(idx, current_sum, first_n, last_n)]

        count = 0
        for i in range(32):
            new_first_n = first_n + i
            new_last_n = last_n + i

            if new_first_n <= n:
                count += solve(idx + 1, current_sum + i, new_first_n, new_last_n)
            else:
                count += solve(idx + 1, current_sum, first_n, new_last_n)

        dp[(idx, current_sum, first_n, last_n)] = count
        return count

    return solve(0, 0, 0, 0)
