        for i in range(32):
            current_sum = (prev_sum << 1) + i
            if current_sum <= 2 * n:
                next_sum = current_sum - prev_sum
                count += solve(idx + 1, next_sum)

        dp[(idx, prev_sum)] = count
        return count

    return solve(0, 0)
