def count_binary_seq(n):
    """
    Finds the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.

    Args:
        n: The length of the binary sequences.

    Returns:
        The count of binary sequences.
    """
    dp = {}

    def solve(index, prev_bit, count):
        if index == 2 * n:
            return 1 if count == 0 else 0

        if (index, prev_bit, count) in dp:
            return dp[(index, prev_bit, count)]

        ans = 0
        upper_sum = prev_bit * n + count
        lower_sum = prev_bit * n + (count - 1)

        if upper_sum == lower_sum:
            ans += solve(index + 1, 0, count + 1)
        elif upper_sum < lower_sum:
            ans += solve(index + 1, 1, count)
        else:
            ans += solve(index + 1, 0, count + 1)

        dp[(index, prev_bit, count)] = ans
        return ans

    return solve(0, 0, 0)
```

