def max_sum_rectangular_grid(grid, n):
    """
    Finds the maximum sum such that no two chosen numbers are adjacent for the given rectangular grid of dimension 2 x n.

    Args:
        grid: A list of lists representing the rectangular grid.
        n: The dimension of the grid.

    Returns:
        The maximum sum.
    """

    if n == 1:
        return sum(grid[0])

    if n == 2:
        return max(sum(grid[i]) for i in range(len(grid))), sum(grid[0])

    dp = {}

    def solve(row, count):
        if row == n:
            return 0

        if (row, count) in dp:
            return dp[(row, count)]

        max_sum = -float('inf')
        for col in range(row + 1, n):
            if col == row:
                continue

            current_sum = grid[row][col] + solve(row + 1, count + 1)
            max_sum = max(max_sum, current_sum)

        dp[(row, count)] = max_sum
        return max_sum

    return solve(0, 0)
```

