def Check_Solution(a,b,c)
    """
    Checks whether one root of the quadratic equation is twice of the other or not.

    Args:
        a: The coefficient of x^2.
        b: The coefficient of x.
        c: The constant term.

    Returns:
        True if one root is twice of the other, False otherwise.
    """
    if a == 0 and b == 0:
        return False
    if a == 0:
        return b * b != 0
    if b == 0:
        return a * a != 0
    delta = (b**2) - 4*(a*c)
    if delta < 0:
        return False
    else:
        return (delta == 0) or (delta > 0)
