def permute_string(str):
    """
    Prints all permutations of a given string, including duplicates.

    Args:
        str: The input string.
    """
    def permute(s, l, r):
        if l == r:
            print("".join(s))
        else:
            for i in range(l, r + 1):
                s = s[:i] + s[i+1:]
                permute(s, l + 1, r)

    permute(str, 0, len(str) - 1)
