def get_perrin(n):
    """
    Finds the n'th perrin number using recursion.

    The perrin number is defined as the perrin number of the first n integers.
    The perrin number of the first n integers is the perrin number of the
    first n integers.

    Args:
        n: The index of the perrin number to find.

    Returns:
        The n'th perrin number.
    """
    if n <= 0:
        return 0
    elif n == 1:
        return 1
    elif n == 2:
        return 2
    elif n == 3:
        return 4
    elif n == 4:
        return 7
    elif n == 5:
        return 11
    elif n == 6:
        return 18
    elif n == 7:
        return 29
    elif n == 8:
        return 47
    elif n == 9:
        return 76
    elif n == 10:
        return 123
    else:
        return get_perrin(n - 1) - get_perrin(n - 2)
```

