def even_or_odd(N):
    """
    Checks whether the hexadecimal number is even or odd.

    Args:
        N: An integer representing the hexadecimal number.

    Returns:
        "Even" if the hexadecimal number is even, "Odd" if the hexadecimal number is odd.
    """
    if N == 0:
        return "Zero"

    num_str = str(N)
    if num_str == "0":
        return "Zero"

    if num_str == "1":
        return "Even"
    elif num_str == "2":
        return "Even"
    elif num_str == "3":
        return "Odd"
    elif num_str == "4":
        return "Even"
    elif num_str == "5":
        return "Odd"
    elif num_str == "6":
        return "Even"
    elif num_str == "7":
        return "Odd"
    elif num_str == "8":
        return "Even"
    elif num_str == "9":
        return "Odd"
    else:
        return "Odd"
