def find_lucas(n):
    """
    Finds the n'th lucas number.

    The lucas numbers are a sequence of numbers where each number is the sum of the previous n numbers.
    For example, the first few lucas numbers are 2, 1, 0, 1, 1, 2, 1, 0, ...

    Args:
        n (int): The index of the lucas number to find.

    Returns:
        int: The n'th lucas number.
    """
    if n == 0:
        return 2
    elif n == 1:
        return 1
    elif n == 2:
        return 0
    elif n == 3:
        return 1
    elif n == 4:
        return 2
    elif n == 5:
        return 4
    elif n == 6:
        return 8
    elif n == 7:
        return 16
    elif n == 8:
        return 32
    elif n == 9:
        return 64
    else:
        lucas_numbers = [2, 1, 0]
        for i in range(1, n):
            next_lucas = sum(lucas_numbers[i - 1:i])
            lucas_numbers.append(next_lucas)
        return lucas_numbers[n - 1]
```

