def extract_freq(test_list):
    """
    Extracts the frequency of unique tuples in the given list order irrespective.
    For example:
    extract_freq([1, 2, 2, 3, 3, 3]) == [2, 3]
    extract_freq([1, 2, 3, 4, 5]) == []
    """
    freq = {}
    for tup in test_list:
        if tup in freq:
            freq[tup] += 1
        else:
            freq[tup] = 1

    result = []
    for tup in freq:
        if freq[tup] == 1:
            result.append(tup)

    return result
